import React, { Component } from "react";
import styled from "styled-components";
import { styleMoney } from "./functionsLibrary";

const H4 = styled.h4`
  font-family: "helvetica-neue, arial";
  font-size: 10px;
  color: #707b81;
`;

class BotaoAcoes extends Component {
  state = { saldoBruto: 12709.14 };
  render() {
    return (
      <span>
        <h4>SALDO BRUTO</h4>
        <p>R$ {styleMoney(this.state.saldoBruto)}</p>
      </span>
    );
  }
}

export default BotaoAcoes;
